import React, { Component } from 'react';
import { Row, Col, Card, CardHeader, CardBody, FormGroup, Label, Input, FormText, InputGroup, InputGroupAddon, InputGroupText } from 'reactstrap';
// React select
import states from '../Forms/AdvancedForms/data/states';
import Select from 'react-select';
import 'react-select/dist/react-select.min.css';

const options = states.US;

class AddHealthArea extends Component {
  constructor(props) {
    super(props);
    this.saveRealmChanges = this.saveRealmChanges.bind(this);
    this.saveCountryChanges = this.saveCountryChanges.bind(this);
    this.state = {
      value1: [],
      value2: []
    };
  }

  saveRealmChanges(value1) {
    this.setState({ value1 });
  }

  saveCountryChanges(value2) {
    this.setState({ value2 });
  }

  render() {

    return (
      <div className="animated fadeIn">
        <Row>
          <Col sm={12} md={6} style={{ flexBasis: 'auto' }}>
            <Card>
              <CardHeader>
                <i className="icon-note"></i><strong>Add Health Area</strong>{' '}
              </CardHeader>
              <CardBody>
                <FormGroup>
                  <Label>Realm</Label>
                  <Select
                    name="form-field-name1"
                    value={this.state.value1}
                    options={options}
                    onChange={this.saveRealmChanges}

                  />
                </FormGroup>
                <FormGroup>
                  <Label>Country</Label>
                  <Select
                    name="form-field-name2"
                    value={this.state.value2}
                    options={options}
                    onChange={this.saveCountryChanges}
                    multi
                  />
                </FormGroup>
                <FormGroup>
                  <Label for="firstName">First Name</Label>
                  <Input type="text"
                    name="firstName"
                    id="firstName"
                    placeholder="First Name"
                    required />
                </FormGroup>
              </CardBody>
              <CardFooter>
                <Button type="submit" size="sm" color="primary"><i className="fa fa-dot-circle-o"></i> Submit</Button>
                <Button type="reset" size="sm" color="danger"><i className="fa fa-ban"></i> Reset</Button>
              </CardFooter>
            </Card>
          </Col>
        </Row>
      </div>
    );
  }
}

export default AddHealthArea;
